import { Box, Stack, Text } from "@chakra-ui/react";


function Signin(){

    return(
        <div className="Signin">
            <Box fontSize="2rem" fontWeight="600">
                <Text>Sign in to Harvest</Text>
            </Box>
            <Stack width="90%" margin="auto">
                <Box>

                </Box>
            </Stack>

        </div>
    )
}

export default Signin;
